import { slide as Menu } from 'react-burger-menu'
import { makeStyles } from '@material-ui/core/styles'
import Profile from '../Images/profilePic.JPG';
import Header from '../Images/header.svg';
   import Blogs from '../MainPages/BlogPosts'
const Home = (({history})=>{

    const useStyles = makeStyles((theme) => ({

        body:{
            flex:"display",
            flexDirection:"column",

            color:"black",
            width:"100%",

        },

        profilePic:{
           borderRadius:"50%",
           width:'150px',
           height:"150px",
           position: "absolute",
           top: "25%",
           left: "50%",
           transform: "translate(-50%, -50%)",
        },

        topInfo:{
            flex:"display",
            flexDirection:"row",
            background:"black",
            color:"white",
            height:"50px",

        }
,
bottomInfo:{
    flex:"display",
