           left: "50%",
           transform: "translate(-50%, -50%)",
borderColor:"black",
borderStyle:"solid",
width:"95%",




}
,
        middleInfo:{
            flex:"display",
           justifyContent:"start",

alignContent:"start"        },

container:{
    position: "relative",
    textAlign: "center",
    color: "white",
  },

  centered:{
    position: "absolute",
    top: "30%",
    left: "50%",
    transform: "translate(-50%, -50%)",
  },


    }))

    var styles = {
      bmBurgerButton: {
        position: 'fixed',
        width: '20px',
        height: '15px',
        left: '36px',
        top: '36px'
      },
      bmBurgerBars: {
        background: 'white'
      },
      bmBurgerBarsHover: {
        background: '#a90000'
      },
      bmCrossButton: {
        height: '24px',
        width: '24px'
      },
      bmCross: {
        background: '#bdc3c7'
      },
      bmMenuWrap: {
        position: 'fixed',
        height: '100%'
      },
      bmMenu: {
        background: 'white',
        padding: '2.5em 1.5em 0',
        fontSize: '1.15em'
      },
      bmMorphShape: {
        fill: 'white'
      },
      bmItemList: {
        color: 'white',
        padding: '0.8em'
      },
      bmItem: {
        display: 'inline-block'
      },
      bmOverlay: {
        background: 'rgba(0, 0, 0, 0.3)'
      }
    }




    const classes = useStyles()
    return(
<div key="mainPage" className={classes.body} >

<div key="header">
<div key="topInfo"  className={classes.topInfo}>
<p>Tech In With Ella</p>


<Menu styles={ styles } >
<a id="home" className="menu-item" href="/">Home</a>
<a id="about" className="menu-item" href="/about">About</a>
<a id="contact" className="menu-item" href="/contact">Contact</a>
</Menu>
</div>

<div key="middleInfo">

<div class="container">
  <img src={Header} alt="Snow" />
  <div class={classes.centered}>Centered</div>
</div>

<div className={classes.middleInfo} >


<img  className={classes.profilePic} src={Profile} alt="Ella Cay Smith" />
</div>

</div>

<div key="bottomInfo" class={classes.bottomInfo} >
<p>If you teach one girl how to code, she will teach three" - Reshma Saujani, Founder of Girls Who Code</p>
<p>Tech In With Ella is a discussion onn the technology industry. The ins and outs from the pov of a young woman. The journey taken to learn the skills to code and navigate the complications and problems that arose.</p>
</div>
<div>
<button onClick>
</button>

</div>

</div>
<div key="Blogs">
<Blogs></Blogs>

</div>
<div key="Subscribe"></div>
</div>
    )
})

export default Home
